        <Row style={{ justifyContent: 'space-between' }}>
          <SubHeader>QUESTIONS</SubHeader>
          <SubHeader style={{ marginRight: '3rem' }}>TRUE/FALSE</SubHeader>
        </Row>
        <Row>
          <Header>01</Header>
          <Box>
            <Questions> hello</Questions>
          </Box>
        </Row>
      </Col>
    </QuizModalFrame>
  );
};

export default SummaryModal;
